import models, { connectDb } from './models';
import routes from './routes';

import 'dotenv/config';
import bodyParser from 'body-parser';
import cookieParser from 'cookie-parser';
import express from 'express';
import cons from 'consolidate';
import path from 'path';

const app = express();

// view engine setup
app.set('views', path.join(__dirname, 'views'));
app.use(express.static(path.join(__dirname, 'public')));
app.engine('html', cons.pug);
app.set('view engine', 'html');

app.use(cookieParser());

// Application-Level Middleware

app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: true }));

app.use(async (req, res, next) => {
  req.context = {
    models,
	me: await models.Authors.findByLogin('rwieruch'),
  };
  next();
});


// Routes
app.use('/', routes.landing);
app.use('/session', routes.session);
app.use('/authors', routes.authors);
app.use('/posts', routes.posts);

app.use('/bootstrap', routes.bootstrap);

/// catch 404 and forwarding to error handler
app.use(function(req, res, next) {
    var err = new Error('Not Found');
    err.status = 404;
    next(err);
});

/// error handlers

// development error handler
// will print stacktrace
if (app.get('env') === 'development') {
    app.use(function(err, req, res, next) {
        res.status(err.status || 500);
        res.render('error', {
            message: err.message,
            error: err
        });
    });
}

// production error handler
// no stacktraces leaked to user
app.use(function(err, req, res, next) {
    res.status(err.status || 500);
    res.render('error', {
        message: err.message,
        error: {}
    });
});


// Start
const eraseDatabaseOnSync = true;

connectDb().then(async () => {
  if (eraseDatabaseOnSync) {
    await Promise.all([
      models.Authors.deleteMany({}),
      models.Posts.deleteMany({}),
    ]);

    createUsersWithMessages();
  }

});

const createUsersWithMessages = async () => {
  const author1 = new models.Authors({
    username: 'rwieruch',
  });

  const author2 = new models.Authors({
    username: 'ddavids',
  });

  const post1 = new models.Posts({
	title: 'Post 1',
    text: 'Published the Road to learn React',
    author: author1.id,
  });

  const post2 = new models.Posts({
	title: 'Post 2',
    text: 'Happy to release ...',
    author: author2.id,
  });

  const post3 = new models.Posts({
	title: 'Post 3',
    text: 'Published a complete ...',
    author: author2.id,
  });

  await post1.save();
  await post2.save();
  await post3.save();

  await author1.save();
  await author2.save();
};

module.exports = app;

